INSERT INTO `kr_mailtemplate` (`mtemid`, `masterid`, `masteridcopy`, `mailbcc`, `mailsub`, `mailcontent`, `mailfooter`, `aftertable`, `IsActive`, `userid`, `createdate`, `modifieddate`) VALUES
(1, 2, 0, 'kalaivani.pixel@gmail.com', 'Contact Us Form', '<p>Thank you for getting in touch! We will review your query/request and get back to you soon. kk<br></p>', '<p>If you have any queries or concerns, please feel free to email us at support@inbase.in</p>', '', 1, 15, '2019-03-20 15:34:56', '2020-08-26 11:02:23'),
(2, 1, 0, 'kalaivani.pixel@gmail.com', 'Inbase Registration Form', '<span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\nEN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">Greetings from&nbsp;<a href=\"#\" style=\"color: blue; text-decoration: underline;\">Inbase.com</a><br>\n<br>\nWe take this opportunity to thank you for registering with us.</span><br>', '<p><br></p>\n<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\nEN-IN;mso-fareast-language:EN-IN;mso-bidi-language:AR-SA\">If you have any\nqueries or concerns, please feel free to email us at&nbsp;<a href=\"mailto:support@inbase.in\" style=\"color: blue; text-decoration: underline;\">support@inbase.in</a></span><br>\n</p>\n<p><br></p>\n<p style=\"margin-right: 0cm; margin-left: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, &quot;serif&quot;;\">\n Thanks &amp; Regards<br> Team -&nbsp;<a href=\"#\" style=\"color: blue; text-decoration: underline;\">support@inbase.in</a></p><br>\n<p><br></p>', '', 1, 1, '2019-03-20 22:18:15', '2019-09-30 11:09:03'),
(3, 4, 0, 'kalaivani.pixel@gmail.com', 'Verification of forgot password', '<p>We have received a password reset request for your account.</p>\r\n<p>Please click on the link below to change/reset your password.</p>', '<p>Team Inbase</p>\r\n<p>Note: Please ignore this mail if you have not requested for password change/reset.\r\n</p>\r\n<p>If you have any queries or concerns, please feel free to email us at support@inbase.com</p>', '', 1, 1, '2019-03-21 12:15:06', '2019-10-14 16:12:06'),
(4, 3, 0, 'kalaivani.pixel@gmail.com', 'Order Placed: Your order has been placed', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> Thank you for order we are at your comfort always for any assistance email us to order@inbase.com and we will get back at the earliest for order status, please login and check.\r\n    <a href=\"\" style=\"text-decoration:none;color:rgb(0,102,153);font:12px/16px Arial,sans-serif\" target=\"_blank\" rel=\"noreferrer\">Your Orders</a> in inbase.com.</p>', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> For any further assistance visit our Help Page.</p>\r\n<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> Please Note: You will get regular order process update till the goods are delivered.</p>', '', 1, 1, '2019-03-21 13:39:17', '2019-09-25 13:48:44'),
(5, 5, 0, 'kalaivani.pixel@gmail.com', 'Pending : Your order has been pending.', '', '', '', 1, 1, '2019-03-22 18:49:17', '2019-03-22 18:49:17'),
(6, 6, 0, 'kalaivani.pixel@gmail.com', 'Processing :Your order has been processing.', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\">We have received your Order # ||order_id||.It is currently under process.We will inform you once the product\r\n    is shipped. </p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\r\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732selfService\" style=\"width: 598px; border-collapse: collapse;\">\r\n                    <tbody>\r\n                        <tr>\r\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\r\n                                <p style=\"margin: 4px 0px 0px; font: 12px/16px Arial, sans-serif;\">Need to make changes to your order? Visit our<span>&nbsp;</span><a rel=\"noreferrer\" style=\"color: rgb(0, 102, 153); text-decoration: none; font: 12px/16px Arial, sans-serif;\">Help page</a><span>&nbsp;</span>for more information.</p>\r\n                            </td>\r\n                        </tr>\r\n                        \r\n                        <tr>\r\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\r\n                                <p style=\"margin: 4px 0px 0px; font: 12px/16px Arial, sans-serif;\">Some products have a limited quantity available for purchase. Please see the products Detail Page for the available quantity. Any orders which exceed this quantity will be automatically canceled.</p>\r\n                            </td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\r\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\r\n                    <tbody>\r\n                        <tr>\r\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\r\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\"><br></p>\r\n                            </td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', 1, 1, '2019-03-22 18:52:17', '2019-09-25 13:45:40'),
(7, 8, 0, 'kalaivani.pixel@gmail.com', 'Shipped : Your order has been shipped.', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> Your Order # ||order_id|| has been shipped to the address mentioned in the Order. Mode of Delivery is </p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\n    <tbody>\n        \n        <tr>\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\n                    <tbody>\n                        <tr>\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\">We hope to see you again soon.<span>&nbsp;</span><br>support@inbase.in<br></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </td>\n        </tr>\n    </tbody>\n</table>', '', 1, 16, '2019-03-22 18:53:25', '2019-05-08 13:30:25'),
(8, 9, 0, 'kalaivani.pixel@gmail.com', 'Canceled : Your order has been cancelled ', '', '', '', 2, 16, '2019-03-22 18:54:14', '2019-04-30 17:01:29'),
(9, 10, 5, 'kalaivani.pixel@gmail.com', 'Returned : Your order has been Returned.', '', '', '', 2, 1, '2019-03-22 18:55:01', '2019-03-22 18:55:01'),
(10, 11, 0, 'kalaivani.pixel@gmail.com', 'Canceled Reversal : Your order has been Canceled Reversal.', '', '', '', 2, 16, '2019-03-22 18:55:57', '2019-04-30 17:01:38'),
(11, 12, 5, 'kalaivani.pixel@gmail.com', 'Refunded : Your order has been Refunded.', '', '', '', 2, 1, '2019-03-22 18:56:48', '2019-03-22 18:56:48'),
(12, 13, 5, 'kalaivani.pixel@gmail.com', 'Denied : Your order has been Denied.', '', '', '', 2, 1, '2019-03-22 18:57:19', '2019-03-22 18:57:19'),
(13, 14, 6, 'kalaivani.pixel@gmail.com', 'Return & Refund  :Your order has been Return & Refund.', '', '', '', 2, 1, '2019-03-22 18:58:25', '2019-03-22 18:58:25'),
(14, 15, 0, 'kalaivani.pixel@gmail.com', 'Delivered : Your order has been Delivered.', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> Your Order # ||order_id|| has been delivered. <br> Thank you for shopping with Inbase. We hope your shopping was a fulfilling experience.    </p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\n    <tbody>\n        \n        <tr>\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\n                    <tbody>\n                        <tr>\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\">We hope to see you again soon.<span>&nbsp;</span><br>support@inbase.in<br></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </td>\n        </tr>\n    </tbody>\n</table>', '', 1, 16, '2019-03-22 18:58:54', '2019-05-08 13:36:10'),
(15, 16, 0, 'kalaivani.pixel@gmail.com', 'Subscribe : Your mail has been Subscribed', '<p>Thank you for your subscription.</p>\r\n<p>You will start receiving the latest product updates and offers.</p>\r\n<p>We wish you a wonderful shopping experience!</p>', '<p>If you have any queries or concerns, please feel free to email us at support@inbase.com</p>', '', 1, 16, '2019-04-09 12:13:38', '2019-05-08 13:29:58'),
(16, 17, 0, 'kalaivani.pixel@gmail.com', 'Generate Proforma Invoice', '', '', '', 1, 16, '2019-04-23 14:42:07', '2019-04-23 14:42:07'),
(17, 9, 0, 'kalaivani.pixel@gmail.com', 'Canceled : Your order has been cancelled ', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> As you requested by phone, we have cancelled your Order # ||order_id||.<br>If you have made the payment already, it will be credited back to your bank account soon. Please continue shopping with us!\r\n</p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\n    <tbody>\n        \n        <tr>\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\n                    <tbody>\n                        <tr>\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\">We hope to see you again soon.<span>&nbsp;</span><br>support@inbase.in<br></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </td>\n        </tr>\n    </tbody>\n</table>', '', 1, 16, '2019-04-30 19:42:35', '2019-05-08 13:41:14'),
(18, 19, 0, 'kalaivani.pixel@gmail.com', 'Failure: Your order has been Failure', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> We find that you tried placing an order with us. We regret to inform that your order could not be completed. Please review your order and try again.  </p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\n    <tbody>\n        \n        <tr>\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\n                    <tbody>\n                        <tr>\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\">We hope to see you again soon.<span>&nbsp;</span><br>support@inbase.in<br></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </td>\n        </tr>\n    </tbody>\n</table>', '', 1, 16, '2019-04-30 19:44:31', '2019-05-08 13:35:34'),
(19, 20, 0, 'kalaivani.pixel@gmail.com', 'Order Success: Your order has been success', '<p style=\"margin:5px 0 0 0;font:12px/16px Arial,sans-serif\"> Thank you for your order. we will send a confirmation when your order ships. Your estimated delivery date is indicated below. If you would like to view the status of your order or make any changes to it, please visit <a href=\"\" style=\"text-decoration:none;color:rgb(0,102,153);font:12px/16px Arial,sans-serif\" target=\"_blank\" rel=\"noreferrer\">Your Orders</a> on Inbase.in. </p>', '<table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732main\" style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; width: 600px; border-collapse: collapse;\">\n    <tbody>\n        \n        <tr>\n            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                <table id=\"m_-2797150272624227062m_-2343339325132390023m_4836535370212275732closing\" style=\"width: 598px; padding: 0px; border-collapse: collapse;\">\n                    <tbody>\n                        <tr>\n                            <td style=\"font-family: Arial, sans-serif; margin: 0px; vertical-align: top; font-size: 12px; line-height: 16px;\">\n                                <p style=\"padding: 0px 0px 20px; border-bottom: 1px solid rgb(234, 234, 234); margin: 10px 0px 0px; font: 12px/16px Arial, sans-serif;\">We hope to see you again soon.<span>&nbsp;</span><br>support@inbase.in<br></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </td>\n        </tr>\n    </tbody>\n</table>', '', 1, 16, '2019-04-30 20:30:45', '2019-05-08 13:35:20'),
(20, 21, 0, 'kalaivani.pixel@gmail.com', 'Individual Dealers Form', '<p>Thanks for contact with us, we will review your brand details and touch with you soon.</p>', '<p>Thanks &amp; Regards</p>\r\n<p>TEAM - Inbase</p>\r\n<p>If you have any queries or concerns, please feel free to email us at support@inbase.com</p>', '', 1, 16, '2019-05-08 15:40:19', '2019-05-08 15:40:29'),
(21, 22, 0, 'kalaivani.pixel@gmail.com', 'Brand Dealers Form', '<p>Thanks for contact with us, we will review your brand details and touch with you soon.</p>', '<p>Thanks &amp; Regards</p>\r\n<p>TEAM - Inbase Team<br></p>\r\n<p>If you have any queries or concerns, please feel free to email us at inbase@inbase.com</p>', '', 1, 15, '2019-05-08 15:41:20', '2020-08-24 18:26:13'),
(22, 4, 0, 'kalaivani.pixel@gmail.com', 'kk', 'kk', 'kk', '', 1, 15, '2020-08-13 11:36:18', '0000-00-00 00:00:00');
