INSERT INTO `kr_product` (`product_id`, `dropdown_id`, `product_name`, `description`, `longdescription`, `metaname`, `metadescription`, `metakeyword`, `model`, `sku`, `product_url`, `quantity`, `configqua`, `minquantity`, `isquaincrease`, `price`, `specialprice`, `spl_fromdate`, `spl_todate`, `isnewproduct`, `isfeaturedproduct`, `newprod_fromdate`, `newprod_todate`, `attributeMapId`, `taxId`, `manufacturerId`, `related_products`, `suggested_products`, `soldout`, `iscustomized`, `uploadecustomizedimg`, `chkpvatt`, `displayinhome`, `isfeatured`, `IsActive`, `created_date`, `modified_date`, `userid`) VALUES
(1, '35,91', 'Desktop Stand', 'Â·    Made of high quality premium aluminum, it\'s sturdy and stable to use.\r\nÂ·    Intense black color adds elite to the work station.\r\nÂ·    Adjustable cell-phone stands offer hands-free convenience and a comfortable user experience.\r\nÂ·    Universal design fits all kinds of phones and tablets up to 8.0â€, to watch videos and play games at your convenience.\r\nÂ·    Multi-angle view can be adjusted 360 degrees; holds phones vertically or horizontally for portrait or landscape view.\r\nÂ·    Silicon pads for non-slip purpose; lightweight yet solid and protective.', 'Enjoy a comfortable, custom viewing angle and hands-free convenience with this Inbase Desktop Stand Phone Holder for all kinds of phones and tablets up to 8.0â€. It offers a lightweight design with a durable aluminum and Polycarbonate body for long-lasting strength and performance. The design also includes slip-resistant silicone pads, which help protect your phone and keep it in place, even when making touch-screen selections. The standâ€™s multi-angle design helps ensure comfortable screen viewing, whether following instructions, video chatting with friends, or watching movies at 360 degree experience. Place your smartphone vertically or horizontally on the stand for portrait- or landscape-viewing options. Either way, the versatile stand securely cradles the phone.', '', '', '', '', 'ib-001', 'desktop-stand-ib-001', 0, 0, 1, 0, 799.00, 0.00, '2021-02-19 00:00:00', '2021-02-19 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 1, 0, 1, '2021-02-04 13:07:39', '2021-04-20 17:06:01', 1),
(2, '35', 'Universal Bike Mount', '360Â° ROTATION AND TILT FREEDOM - simply adjust and secure your phone to any angle and position that suits your preference and enjoy the comfort of your ride!\r\nMOUNT/UNMOUNT PHONE IN SECONDS - This bike phone mount is super reliable and easy to use. Keep your hands on the handlebar +100 to SAFENESS!\r\nStable & secure - Automatic lock design with one-way rotatable gear prevents your device from falling, resilient support corners and high quality foam protection are able to catch your phone firmly without any scratches and prevent your phone from shaking while travelling.\r\nEasy Installation: Convenient tool-free installation makes it easy to mount to any Bike Handlebar, only need to locate and lock nuts.\r\nUniversal Compatibility: Works with virtually any iPhone, Android smartphones', 'When you need navigation to find your way or simply the melody of a favorite song to pass the miles, the Inbase universal bike mount is a must have. Mount any cell phone to any bicycle, motorcycle, scooter or any handlebars. No tools for installation required. Works well with any protective cases. Quickly and easily mount and unmount your phone or device. With this bike mount makes your phone or other devices stay close to your hands and easy to get it when driving.', '', '', '', '', 'ib-002', 'universal-bike-mount-ib-002', 0, 0, 1, 0, 599.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 16:35:16', 17),
(3, '35', 'Robotic Arm Holder', '360Â° ROTATION AND TILT FREE360Â° ROTATION AND TILT FREEDOM - Simply adjust and secure your phone to any angle and position that suits your preference and enjoy the comfort of your ride!\nMOUNT/UNMOUNT PHONE IN SECONDS - This robotic arm holder phone mount is super reliable and easy to use. Keep your hands on the handlebar +100 to SAFENESS!\nStable & Secure - Automatic lock design with one-way rotatable gear prevents your device from falling, resilient support corners and high quality foam protection are able to catch your phone firmly without any scratches and prevent your phone from shaking and wobbling.\nEasy Installation: Convenient tool-free installation makes it easy to use.\nDOM - Simply adjust and secure your phone to any angle and position that suits your preference and enjoy the comfort of your ride!', 'When you need navigation to find your way, or simply the melody of a favorite song to pass the miles, the Inbase robotic arm holder is a must have. The mount keeps your phone handy and allows you to ride smoothly. Enjoy comfortable and safe rides with your phone at hand like never before. Mount any cell phone to your cars, no tools for installation required. Works well with any protective cases. Quickly and easily mount and unmount your phone or device. With this arm holder makes your phone or other devices stay close to your hands and easy to get it when driving. Free your hands - Perfect for Reading, Movie & Video watching in car and anywhere. Sturdy and Comfortable - 360 Degree Rotation Flexible, Ultra Stable, No Shaking, Hold Your Phone Firmly In Place, With Soft Sponge. To meet the multi-angle vision, 360-degree design, multi-position adjustable angle, free rotation to meet different visual needs.', '', '', '', '', 'ib-003', 'IB_003', 0, 0, 1, 0, 799.00, 0.00, NULL, NULL, 0, 0, NULL, NULL, 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-04 13:07:39', 1),
(4, '35,36,39,92', 'Urban Fit', '\"1.Full Touch Screen\r\n2.90 mins Full Charge\r\n3.Up to 7 Days Run Time\r\n4.15 Days Standby\r\n5.IP68 Waterproof\r\n6.Heart Rate Sensor\r\n7.Call and Message Notifications\r\n8.Easy Swappable Straps\r\n9.8 Sports Modes\r\n\"', 'An urban Fit smart watch comes with superlight and impact resistant polycarbonate steel watch case. Itâ€™s now available in 3 latest and flamboyant swappable strap colors that you can swap it in a blink. Urban fit watches offer a full touch screen with curved display and powerful features with no buttons. International standard rating of IP68 offers resistant to submersion up to depth 1.5m for 30 minutes maximum. It is designed with multi-sport mode, one touch camera control, pedometer, GP from mobile, music control and call & SMS notification.', '', '', '', '', 'ib-004', 'urban-fit-ib-004', 0, 0, 1, 0, 4999.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 18:11:50', 17),
(5, '35,36', 'Earphone M5', '1. Frequency range â€“ 20hz -20000Khz\r\n2.Sensitivity â€“40db +/- 5db\r\n3. Impedance â€“ 10mm\r\n4.Connector type â€“3.5mm\r\n5.Cable length â€“ 120cm +/- 5cm\r\n6. Cable material â€“ TPE round wire\r\n7. Driver size â€“ 10mm\r\n8.Hands Free Call - Yes\r\n9.In-ear - Yes', 'Get ready to redefine music experience and utility with the inbase in-Ear headphone M5. Designed with TPE durable wire and additional Noise cancellation feature made this earphone standout among the rest. Special combination of stereo bass effect with HD mic makes this product perfect for music lovers. Inbase M5 is compatible with almost every device that carries a 3.5mm slot.', '', '', '', '', 'ib-005', 'earphone-m5-ib-005', 0, 0, 1, 0, 299.00, 0.00, '2021-03-27 00:00:00', '2021-03-27 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-03-27 10:43:15', 17),
(6, '35', 'TURBO Power Bank 10000 Mah', '1. No of input ports - 2\r\n2. No of output ports â€“ 2\r\n3. Output 1 â€“ DC 5V 2.1 A\r\n4. Output 2 â€“ DC 5V 2.1A\r\n5. Total output  - DC 5V 2.4A max\r\n6. Type of Input â€“ MICRO/TYPE C\r\n7. Capacity â€“ 10000 MAH\r\n8. Cell Type â€“ Li polymer \r\n9. No of charging cycle â€“ 500+\r\n10. Total Output power â€“ 2.1A\r\n11. LED indicator â€“ yes', 'Inbase Turbo Power bank 10000mAh gives 2.4Amp fast charging and inbuilt superior quality industrial grade materials and premium internal circuit to ensure full protection for your valuable devices against over-current. Dual outputs and input ports give two -way fast charging. Itâ€™s the perfect partner whenever, and wherever you need to charge. A super-high 10000 mAh capacity with two high speed type C ports is all contained in a single power bank. LED indicator displays can accurately keep track of remaining power, input and output status. Compatible with all C type Smartphoneâ€™s, tablets, MP3 players, cameras, hard drives, e-readers, external batteries, handheld game consoles.', '', '', '', '', 'ib-006', 'turbo-power-bank-10000-mah-ib-006', 0, 0, 1, 0, 1499.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 17:19:51', 17),
