(9, '33,34,35,39,93', 'Boom Lite', 'Enjoy Crystal clear call and rock solid music with Inbase Boom Pro Max Speaker. Designed with a specially designed Graphene Coated Driver with a driver size of 57 mm and Output Power of 5Watts*2, the tough speaker is also IPX68 certified which allows you to take it with you for your outdoor pool parties. With a playtime of 6 hours on a single charge, the speaker takes 4 hours to fully charge. The tough speaker comes with Bluetooth version V4.2 and TWS feature ensuring streamlined wireless connectivity', 'Inbase Boom Lite speaker is ergonomically designed and engineered for greater clarity, sound and offers big beats on the go. With long lasting battery and play time up to 5 hours on a single charge makes it stand out from the rest. It has a Unique TWS function which enables users to connect to an additional speaker to make the sound Stereo. The workmanship of this speaker has twice the impact with multiple connectivity modes as Bluetooth v4.2, FM & SD card slot. The body is constructed of durable materials, which offers all around withstanding protection. Inbase Boom lite speakers are the perfect for any indoor and outdoor activities.', '', '', '', '', 'ib-009', 'boom-lite-ib-009', 0, 0, 1, 0, 1499.00, 0.00, '2021-04-10 00:00:00', '2021-04-10 00:00:00', 0, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-04-10 15:04:59', 1),
