(56, '33,35', 'Zinc Alloy Fast Charge Lightning Cable - 1.2M', '\"1. Compatibility â€“ Lightning supporting devices\r\n2. Connector type â€“ Lightning\r\n3. Reversible â€“ No\r\n4. Connector â€“ 1\r\n5. Cable type â€“ Flat\r\n6. Cable Length â€“ 1.2 meter\r\n7. Cable Material â€“ TPU material\r\n8. Power Output â€“ 2.4A\r\n9. Cable speed â€“ 480 mbps\r\n10. Cable core â€“ Zinc alloy\r\n11. Tangle free cord â€“ Yes\r\n12. Special feature â€“ comes with LED indicator\r\n\"', 'Enjoy charger time up to 50% faster than most standard alternatives and data transfer via USB 2.1Amp. High quality TPU material cable provides safe high speed charge and stable data transmission at very high speed. Equipped with a versatile lightning connector, this cable is compatible with a wide variety of devices. LED indicator cable compatible with iphone, tablets, MP3 players, cameras, hard drives, e-readers, external batteries, handheld game consoles from all the brands and all other lightning type connecting devices.\r\nFeatures\r\nÂ·       HIGH PERFORMANCE: Excellent pull resistance and flexibility make it more durable than standard cables.\r\nÂ·       CABLE DURABILITY: Aluminium alloy+TPU cable with anti-oxidation and corrosion resistance adds additional durability and withstand 10000+ bending test.\r\nÂ·       FAST SYNC AND CHARGE: Quick Data Transmission Fast Charging up to 2.1A.', '', '', '', '', 'ib-056', 'zinc-alloy-fast-charge-lightning-cable-12m-ib-056', 0, 0, 1, 0, 1299.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 16:41:55', 17),
(57, '35', 'Aux Cable 1.2M', '\"1. Cable length â€“ 1.2 meter\n2. Cable speed â€“ 480 Mbps\n3. Connector type one â€“ 3.5mm\n4. Connector type two â€“ 3.5mm\n5. Cable type â€“ Nylon braided\n6. Connector material â€“ Gold plated plug\n\"', 'Inbase 3.5mm male to male Aux cable fits all digital devices with standard 3.5mm aux ports. Gold plated plug, it better matches the connection device. Anti â€“ jamming, it provides fast conduction of audio signal. Made of high quality enameled pure copper wire which gives high fidelity, stable transmission, pure sound quality and incredibly durable lasts a lot longer than other AUX cables. Universal compatible with both input (phone, tablets, computers and MP3) and output devices (speakers, car and headphones).\nFeatures\nAux cable fits all digital devices with all 3.5mm aux ports.\nUniversal compatible with most of the male to male connectors.\nAux cable helps to connect your phone to speaker, computer to speaker, music player to headset.\n Tangle-free cord design eliminates bunching, tangles, knots.', '', '', '', '', 'ib-057', 'IB_057', 0, 0, 1, 0, 499.00, 0.00, NULL, NULL, 0, 0, NULL, NULL, 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-04 13:07:39', 1),
(58, '35', 'Audio Splitter 3.5MM', '\"1. Connector type one â€“ 3.5mm\r\n2. Connector type two â€“ 3.5mm\r\n3. Comes with stylus\r\n\"', 'nbase 3.5mm Y shaped Audio Splitter with touch pen convert one jack into two 3.5mm jacks ideal for sharing Music with Anyone and suitable for navigating all touch devices. Male to dual female 3.5mm Audio splitter fits all digital devices with standard 3.5mm aux ports and transmits audio in stereo format. Audio splitter connector ensures accurate data transmission and eliminates signal loss and offers the clear stereo sound in both outputs. The precise measurement connector contributes to safe and reliable connection. Experience awesome sound and excellent audio transfer performance with this audio splitter. No need for lots of different cables if you have this audio splitter; itâ€™s compatible with anything that is a 3.5 mm female jack with MP3s, smart phones, tablets, laptops & more.\r\n\r\nFeatures\r\n\r\nAudio splitter â€“ that allows two headphones to be connected through one audio jack.\r\n3.5mm jack headphone splitter extension cable can transfer audio from your mobiles, MP3 players, CD players, Laptops, tablets, PlayStation to 2 female output devices including headphones, speakers and more.\r\nEnjoy both comfort and style with this audio splitter, which is simple to use and easy to carry.', '', '', '', '', 'ib-058', 'audio-splitter-35mm-ib-058', 0, 0, 1, 0, 399.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 16:41:29', 17),
