(62, '37,38,91', 'Type C - Micro Connector', '\"1. No of connectors - 2\r\n2. Compatible Male connectors â€“ Type c\r\n3. Compatible female connectors - Micro\r\n4. Type â€“ Data sharing/ power sharing\r\n\"', 'Our USB-C (male) to Micro USB adapter (female) allows you to charge and sync USB-c devices with a micro USB cable. Plug and play design with no external driver or software installation needed. It has high speed data transmission upto 480 MBPS sync capacity. Reversible design simplifies the connection plug and unplug easily without checking the connector orientation.\r\n.Features\r\nHigh speed data transmission upto 480 MBPS\r\nMade with high pull-up resistor which supports charging upto 2.4A\r\nCompact Metallic Build: components with metallic construction.\r\nPlug and play design, no external driver or software installation needed.\r\nLight and compact, so easy to carry anywhere.', '', '', '', '', 'ib-062', 'type-c-micro-connector-ib-062', 0, 0, 1, 0, 299.00, 0.00, '2021-02-08 00:00:00', '2021-02-08 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 1, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-08 12:47:21', 17),
(63, '35,38,39,91', 'USB to Type C Female Connector', '\"1. No of connectors - 2\r\n2. Compatible Male connectors â€“ Micro\r\n3. Compatible female connectors - Type C\r\n4. Type â€“ Data sharing/ power sharing\r\n\"', 'Our USB-Micro (male) to Type C connector (female) allows you to sync USB-Micro devices with a type C port. OTG connector designed for easy plugging and unplugging. No external driver or software installation needed. Use this adapter to connect the Type C connector to a micro USB cable to sync and charge. This connector converts a male micro USB connection to a female type C connection. Smaller, smarter and more convenient connector that simplifies the connection plugs and unplugs easily without checking the connector orientation.\r\n \r\nFeatures\r\n \r\nÂ·    USB-Micro (male) to type C adapter (female) allows you to charge and sync Micro USB devices with a type C cable, plug and play design, no external driver or software installation needed.\r\nÂ·    Compact Metallic Build: Components with metallic construction take the Arrow mini adapter anywhere, light and compact, it is so small that you can fit it into the coin pocket of your jeans.\r\nÂ·    Device Compatibility: Compatible with all Type C supporting devices and micro USB cable will also be compatible for type C by using this converter.', '', '', '', '', 'ib-063', 'usb-to-type-c-female-connector-ib-063', 0, 0, 1, 0, 399.00, 0.00, '2021-02-08 00:00:00', '2021-02-08 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-08 12:57:15', 17),
