(93, '35', 'Urban BT Neckband X1', '\"1. Headphone type â€“ In the ear\r\n2. With Microphone - yes\r\n3. Inline Remote - yes\r\n4. Bluetooth version â€“ 5.0\r\n5. Water Resistant â€“ IP X4\r\n6. Speaker  - 10mm \r\n8. Charging Time â€“ 1.5 hrs\r\n9. Play Time -  10 hrs\r\n10. Foldable/collapsible â€“ Yes \r\n11. Dual pairing \r\n\"', 'Built with Titanium Dynamic Driver, Urban X1 is a source of top quality sounds with super bass effects.  \r\nUrban X1 has a 10-hour hassle-free music listening feature that hosts an amazing battery. Time for a non-stop party! \r\nRated with an IPX4, Urban X1 is water resistant and absorbs sweat like it never happened. \r\nAn in-built magnetic system allows the earbuds to stick with each other when you decide to put the neckband aside. \r\nLatest upgrade of Bluetooth technology, provides seamless and stable connection.\r\nGo ahead and pair with two devices at the same time, without having to juggle between tasks.', '', '', '', '', 'ib-093', 'urban-bt-neckband-x1-ib-093', 0, 0, 1, 0, 2499.00, 0.00, '2021-02-05 00:00:00', '2021-02-05 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 7, 0, '', '', 0, 0, '', 0, 0, 0, 1, '2021-02-04 13:07:39', '2021-02-05 17:27:36', 17),
