(1, 73, '16165858280Pin_Drop_Silence.jpg', 'Pin Drop Silence', 'With Noise Cancellation feature, this clip microphone ensures a smooth and perfect recording with no noise disturbance.', 1, 1, 17, 1, '2021-03-24 17:07:08', '2021-03-24 17:07:08'),
(2, 73, '16165858287LOng_Product_Life.jpg', 'Long Product Life', 'Made with Ultra Durable PVC Material for Cable, this clip microphone can go on for years and ensure durability and ruggedness in your daily recording.', 2, 2, 17, 1, '2021-03-24 17:07:08', '2021-03-24 17:07:08'),
(3, 73, '16165858283Record_From_Distance.jpg', 'Record from Distance', 'With a 1.5 meter cable length, you can record from long distance without tangles and hindrances.', 3, 1, 17, 1, '2021-03-24 17:07:08', '2021-03-24 17:07:08'),
(4, 73, '16165858285Something_For_Extra.jpg', 'Something extra for clear recording', 'The clip microphone comes with tie clip and foam windscreen', 4, 2, 17, 1, '2021-03-24 17:07:08', '2021-03-24 17:07:08'),
(5, 74, '16166535802Pin_Drop.jpg', 'Pin Drop Silence', 'With Noise Cancellation feature, this clip microphone guarantees a smooth and perfect recording with no noise disturbance.', 1, 1, 17, 1, '2021-03-25 11:56:20', '2021-03-25 11:56:20'),
(6, 74, '16166535805Long_Product_Durablity.jpg', 'Long Product Life', 'Made with Cable Fiber, this clip microphone can go on for years and ensure durability and ruggedness in your daily recording.', 2, 2, 17, 1, '2021-03-25 11:56:20', '2021-03-25 11:56:20'),
(7, 74, '16166535806Record_From_Distance.jpg', 'Record from Distance', 'With a 1.5 meter cable length, you can record from long distance without tangles and hindrances.', 3, 1, 17, 1, '2021-03-25 11:56:20', '2021-03-25 11:56:20'),
(8, 74, '16166535803Something_extra.jpg', 'Something extra for clear recording', 'The clip microphone comes with mind muffs, tie clip and foam windscreen', 4, 2, 17, 1, '2021-03-25 11:56:20', '2021-03-25 11:56:20'),
(9, 9, '16166787299Small_But_Packs_A_Bunch.jpg', 'Small But Packs a Punch', 'Boom Lite is small, compact and lightweight speaker as it weighs only 271 grams and comes with a powerful output of 3W*1, promising a combination of high performance and unmatchable style.', 1, 1, 17, 1, '2021-03-25 14:39:36', '2021-04-10 15:04:59'),
(10, 9, '16166633766Tws_Connection.jpg', 'TWS Technology', 'Boom Lite speaker gives you the possibility to connect two speakers thanks to its True Wireless Connection (TWS) feature providing you a stereo sound experience.', 2, 2, 17, 1, '2021-03-25 14:39:36', '2021-04-10 15:04:59'),
(11, 9, '16166633765Unmatched_Range_&_Connectivity.jpg', 'Unmatched Range and Connectivity', 'The small party speaker comes equipped with Bluetooth V4.2 which provides a connectivity and wireless range of 10 metres making it an ideal companion to listen to your favourite songs while cooking your favourite dish in your kitchen.', 3, 1, 17, 1, '2021-03-25 14:39:36', '2021-04-10 15:04:59'),
(12, 9, '16166787293Consume_LEss_Give.jpg', 'Consume Less, Give More', 'The speaker has an in-built battery capacity of 500 mAh which has a charge time of 2 hours but gives out an unparalleled playback time of 4 hours in single charge, doubling your leisure listening time.', 4, 2, 17, 1, '2021-03-25 14:39:36', '2021-04-10 15:04:59'),
(13, 9, '16166787293Play_Rain.jpg', 'Play in Rain Too', 'Certified with IP68, the speaker is water resistant making it ideal for water related activities and yeah, you can enjoy sweet monsoon melodies', 5, 1, 17, 1, '2021-03-25 18:55:29', '2021-04-10 15:04:59'),
(14, 9, '16166787297more_Connectivity.jpg', 'More Connectivity', 'Apart from Bluetooth, you can also play your favourite tracks on Boom Lite through USB cable, TF card, FM, and Aux cable.', 6, 2, 17, 1, '2021-03-25 18:55:29', '2021-04-10 15:04:59'),
(15, 9, '16166787294Favorite_Colour.jpg', 'Comes in Your Favourite Colors', 'Apart from classic black, the speaker is also available in Red, Green, Grey and Blue colors to choose from.', 7, 1, 17, 1, '2021-03-25 18:55:29', '2021-04-10 15:04:59'),
(16, 90, '16167585007call_without_hands.jpg', 'Call Without Hands', 'The wired earphone allows users to enjoy hands-free calling experience by having a microphone and volume adjustable controls which allows the user to control the volume and talk while performing other activities such as driving, cooking etc.', 1, 1, 17, 1, '2021-03-26 17:04:59', '2021-03-27 10:46:16'),
(17, 90, '16167585006Durable.jpg', 'Durable, Stylish and Crystal Clear', 'Made with TPE round cable wire, the wired earphone has a length of 1.2 metre and comes in 2 colors-  Black and White.', 2, 2, 17, 1, '2021-03-26 17:04:59', '2021-03-27 10:46:16'),
