(36, 79, '16167604809Works_in__Exreme.jpg', 'Work in extreme conditions', 'This TWS earbuds works fine in extreme temperatures ranging from -10 to 60 Celsius showcasing its toughness and endurance.', 1, 1, 17, 1, '2021-03-26 17:38:00', '2021-03-26 17:38:00'),
(37, 79, '16167604802Seamless_COnnectivity.jpg', 'Seamless Connectivity and Unmatched Range', 'With Advanced Bluetooth Version 5.0 and wireless range of 10 metres, enjoy your favorite music with any hindrance or disturbance without fearing the distance.', 2, 2, 17, 1, '2021-03-26 17:38:00', '2021-03-26 17:38:00'),
