(43, 80, '16167608148Seamelss_Connectivity.jpg', 'Seamless Connectivity and Unmatched Range', 'With Advanced Bluetooth Version 5.0 and wireless range of 10 metres, enjoy your favorite music with any hindrance or disturbance without fearing the distance.', 1, 1, 17, 1, '2021-03-26 17:43:34', '2021-03-26 17:43:34'),
(44, 80, '16167608141Never_Runout_OF_Battery.jpg', 'Never run out of battery', 'With a  charging time of 90 minutes and standby time of 14 days, never fear running out of battery. If without any power, just put it back in the charging case as it has 450 mAh capacity and will charge your earbuds in no time.', 2, 2, 17, 1, '2021-03-26 17:43:34', '2021-03-26 17:43:34'),
(45, 80, '16167608142Light_As_A_Fether.jpg', 'Light as a feather', 'Weighing only 4.6 grams each, Free Buds 3 is an ideal companion for all your extensive workout and physical activities with being sweat and water resistant.', 3, 1, 17, 1, '2021-03-26 17:43:34', '2021-03-26 17:43:34'),
(46, 76, '16167610047TWS.jpg', 'TWS Technology', 'Boom Pro speaker gives you the possibility to connect two speakers thanks to its True Wireless Connection (TWS) feature amplifying your stereo sound listening experience.', 1, 2, 17, 1, '2021-03-26 17:46:44', '2021-04-26 12:58:36'),
(47, 76, '16167610043Unmatched_Range_&_Connectivity.jpg', 'Unmatched Range and Connectivity', 'The Boom Pro comes equipped with Bluetooth version V4.2 which provides a connectivity and wireless range of 10 metres making it an ideal companion to listen to your favourite songs while cooking your favourite dish in your kitchen.', 2, 1, 17, 1, '2021-03-26 17:46:44', '2021-04-26 12:58:36'),
(48, 76, '16167610042Big_BAttery_&_Long_Playtime.jpg', 'Big Battery, Long Playtime', 'The speaker has an in-built battery capacity of 1500 mAh which has a charge time of 4 hours but gives out an unparalleled playback time of 5 hours in single charge, doubling your leisure listening time.', 3, 2, 17, 1, '2021-03-26 17:46:44', '2021-04-26 12:58:36'),
(49, 76, '16167610042Play_Rain_in_too.jpg', 'Play in Rain Too', 'Certified with IP68, Boom Pro is water resistant making it ideal for pool parties and water related activities and yeah, you can enjoy sweet monsoon melodies too.', 4, 1, 17, 1, '2021-03-26 17:46:44', '2021-04-26 12:58:36'),
(50, 76, '16167610041ROugh_&_Tough.jpg', 'Tough and Rugged', 'Boom Pro is made with durable fabric which make it a rugged and finished design  and comes with a specially designed Graphene Coated Driver with a size of 57mm getting out a powerful output of 5W*1, promising a combination of high performance and unmatchable style.', 5, 2, 17, 1, '2021-03-26 17:46:44', '2021-04-26 12:58:36'),
(51, 77, '16167611921TWS_Connection.jpg', 'TWS Technology', 'Boom Pro Max speaker give you the possibility to connect two speakers thanks to its True Wireless Connection (TWS) feature amplifying your stereo sound listening experience.', 1, 1, 17, 1, '2021-03-26 17:49:52', '2021-04-26 12:50:33'),
(52, 77, '16167611924Unmatched_Range_&_Connectivity.jpg', 'Unmatched Range and Connectivity', 'The Boom Pro Max comes equipped with Bluetooth version V4.2 which provides a connectivity and wireless range of 10 metres making it an ideal companion to listen to your favourite songs while cooking your favourite dish in your kitchen.', 2, 2, 17, 1, '2021-03-26 17:49:52', '2021-04-26 12:50:33'),
(53, 77, '16167611922Single_Charge.jpg', 'Goes Long on Single Charge', 'The speaker has a charge time of 4 hours but gives out an unparalleled playback time of 6 hours in single charge, doubling your leisure listening time.', 3, 1, 17, 1, '2021-03-26 17:49:52', '2021-04-26 12:50:33'),
(54, 77, '16167611924PLay_in_Rain_Too.jpg', 'Play in Rain Too', 'Certified with IP68, Boom Pro Max is water resistant making it ideal for pool parties and water related activities and yeah, you can enjoy sweet monsoon melodies too.', 4, 2, 17, 1, '2021-03-26 17:49:52', '2021-04-26 12:50:33'),
(55, 77, '16167611927Rough_&_Tough.jpg', 'Tough and Rugged', 'Boom Pro is made with durable fabric which make it a rugged and finished design  and comes with a specially designed Graphene Coated Driver with a size of 57mm getting out a powerful output of 5W*2, promising a combination of high performance and unmatchable style.', 5, 1, 17, 1, '2021-03-26 17:49:52', '2021-04-26 12:50:33'),
(56, 75, '16167614204Pin_Drop_Silent.jpg', 'Pin Drop Silence', 'With Noise Cancellation feature, this clip microphone guarantees a smooth and perfect recording with no noise disturbance.', 1, 1, 17, 1, '2021-03-26 17:53:40', '2021-03-26 17:53:40'),
(57, 75, '16167614207Long_Product_Life.jpg', 'Long Product Life', 'Made with Cable Fiber, this clip microphone can go on for years and ensure durability and ruggedness in your daily recording.', 2, 2, 17, 1, '2021-03-26 17:53:40', '2021-03-26 17:53:40'),
(58, 75, '16167614206Record_From_Long_Distance.jpg', 'Record from Distance', 'With a 1.5 meter cable length, you can record from long distance without tangles and hindrances.', 3, 1, 17, 1, '2021-03-26 17:53:40', '2021-03-26 17:53:40'),
(59, 75, '16167614207Something_Exra.jpg', 'Something extra for clear recording', 'The clip microphone comes with mind muffs, tie clip and foam windscreen', 4, 2, 17, 1, '2021-03-26 17:53:40', '2021-03-26 17:53:40');
